style.css:
@-moz-document domain('calendar.google.com'){
    /* main body */
:root {
    color-scheme: dark;
    --primary: rgb(187, 134, 252);
    --primary-variant: rgb(55, 0, 179);
    --on-primary: rgb(0, 0, 0);
    --secondary: rgb(3, 218, 198);
    --secondary-variant: rgb(3, 218, 198);
    --on-secondary: rgb(0, 0, 0);
    --on-secondary-variant: rgb(0, 0, 0);
    --surface: rgb(18, 18, 18);
    --surface-transparent: rgba(255,255,255,0);
    --on-surface: rgb(255, 255, 255);
    --on-surface-variant: rgb(220, 220, 220);
    --on-surface-variant-agm: rgb(220, 220, 220);
    --background: rgb(18, 18, 18);
    --on-background: rgb(255, 255, 255);
    --textfield-surface: rgb(18, 18, 18);
    --textfield-primary: rgb(187, 134, 252);
    --textfield-hairline: rgb(220, 220, 220);
    --textfield-error: rgb(207, 102, 121);
    --textfield-on-surface-variant: rgb(255, 255, 255);
    --hairline: rgb(218,220,224);
    --error: rgb(207, 102, 121);
    --on-error: rgb(0, 0, 0);
    --shadow-1: 0px 1px 2px 0px rgba(60,64,67,0.3),0px 1px 3px 1px rgba(60,64,67,0.15);
    --shadow-5: 0px 4px 4px 0px rgba(60,64,67,0.3),0px 8px 12px 6px rgba(60,64,67,0.15);
    --fab: rgb(43, 43, 43);
    --fab-hover: rgb(187, 134, 252);
    --dimmed: rgba(32,33,36,0.38);
    --chip-hover: rgb(241,243,244);
    --now: rgb(234,67,53);
}

/* header */
.gb_sd.gb_Jd {
    background: rgb(18, 18, 18);
}

/*icons on the header*/
.yR9sJd.yR9sJd:not(:disabled), .gb_Fa svg, .gb_Oc svg, .gb_ad .gb_Ld, .gb_0c .gb_Ld, .h8Aqhb .xIrdD, .ec9Aq, .JJyfjc, .xYvThe:not(:disabled), .xYvThe:not(:disabled), .NkK3Fc span[role=heading] {
    color: rgb(187, 134, 252);
}

/* passed events */
.Jmftzc.EiZ8Dd.UflSff, .Jmftzc.YkxAAf.UflSff {
    color: black; /* changes text colour to black */
}



/*################ EVENT CREATOR / EDITOR ######################*/

/* text color */
.jgvuAb.iWO5td .ncFHed, .TgcD5e.CCDcoc .zHQkBf, .VfPpkd-I9GLp-yrriRe>label, .VfPpkd-LgbsSe .VfPpkd-vQzf8d {
    color: rgb(255, 255, 255)
}

/* task or event text color */
.zmrbhe>.kkUTBb  {
    color: white;
}

/* formatting buttons */
.qmMNRc {
    color: white;
}

/* add guest */
.ULpymb .zHQkBf {
    color: white;
}


/* choosing boxes*/
.jgvuAb.iWO5td .ncFHed, .PVQHSc.zIeiH .jBmls{
    background: black;
}
.ncFHed .MocG8c.KKjvXb, .w8UdJc, .VKy0Ic[aria-selected=true], .oKubKe[aria-selected=true] {
    background-color: #303030;
}

/* date selector*/
.cPMh0b {
    background: black;
}

/*individual dates on selector*/
.W0m3G .r4nke {
    color: rgb(255, 255, 255);
    background-color: #383838;
}

/*time-zone select font color*/
.MocG8c {
    color: white;
}

/* discard display */
.VhQQpd .df5yGe, .OE6hId {
    background: black;
}
}
